    camera: "Fujifilm X-Pro2",
    lens: "Fujifilm 35mm f/1.4",
    date: "3/11/2022",
    location: "Queen Anne, Seattle, WA",
  },
  {
    image: "./photos/clouds.jpg",
    camera: "Fujifilm X-Pro2",
